    false,nt"url": null,nt"notes": "The Trace Atmospheric Gas Analyzer (TAGA)
    buses are self-contained mobile laboratories that conduct instant-result monitoring
    of air quality at particular locations. From May 18-June 6, 2010, EPAu2019s TAGA
    buses monitored for the two chemicals found in the COREXIT dispersants that have
    the highest potential to get into the air in any significant amounts: EGBE (2-butoxyethanol)
    and dipropylene glycol monobutyl ether. In addition to being found in the COREXIT
    dispersants, these compounds are found in cleaning products and coatings. As a result,
    we have not beeen able to identify the source of the measured compounds. The TAGA
    buses detected very low levels of these chemicals in the air, at a limited number
    of the locations sampled along the Gulf Coast. The levels found were well below
    those that are likely to cause health effects, and suggest that the use of dispersants
    on the oil spill would not have a significant impact on air quality on land.",nt"license_title":
